function extractPhotos(html) {
  const photos = [];
  
  console.log('\n🔍 Searching for photos...\n');
  
  // Method 1: Look for main photo data in scripts
  const scriptMatches = html.match(/<script[^>]*>([\s\S]*?)<\/script>/gi) || [];
  
  for (const script of scriptMatches) {
    // Look for photo URLs in various formats
    const urlMatches = script.match(/https:\/\/live\.staticflickr\.com\/\d+\/\d+_[a-z0-9]+_[a-z]\.jpg/gi);
    
    if (urlMatches) {
      urlMatches.forEach(url => {
        // Upgrade to 'b' size (1024px) for better quality
        const highResUrl = url.replace(/_[a-z]\.jpg$/, '_b.jpg');
        
        if (!photos.find(p => p.url === highResUrl)) {
          photos.push({
            id: `photo-${photos.length + 1}`,
            url: highResUrl,
            title: `${ALBUM_INFO.title} - Photo ${photos.length + 1}`,
            width: 1024,
            height: 683
          });
        }
      });
    }
  }
  
  // Method 2: Look for img tags
  const imgRegex = /<img[^>]*(?:src|data-defer-src)="(https:\/\/[^"]*staticflickr[^"]*)"[^>]*>/gi;
  let match;
  
  while ((match = imgRegex.exec(html)) !== null) {
    let url = match[1];
    
    // Only process actual photo images
    if (url.includes('live.staticflickr.com')) {
      // Upgrade to high res
      url = url.replace(/_[a-z]\.jpg$/, '_b.jpg');
      
      if (!photos.find(p => p.url === url)) {
        photos.push({
          id: `photo-${photos.length + 1}`,
          url: url,
          title: `${ALBUM_INFO.title} - Photo ${photos.length + 1}`,
          width: 1024,
          height: 683
        });
      }
    }
  }
  
  return photos;
}

